script: |
  super -f text -I q6142.spq | sort > q6142.out

inputs:
  - name: q6142.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE - col0 + + col2 - + - 6 * - col1 + + - col2 NOT IN ( - col2, + 64 );
  - name: tab1

outputs:
  - name: q6142.out
    data: |
      51	14	96
      85	5	59
      91	47	68
